    return (
        <div className="navbar">
        <h1 className="company">NEEMAN'S</h1>
        <div className="headings">
        <a>NEW</a>
        <a>MEN</a>
        <a>WOMEN</a>
        <a>OFFERS</a>
        <a>ABOUT US</a>
        </div>
        </div>
    );
}

export default NavBar;
